import React, { useEffect } from "react";

import Head from "next/head";
import Logo from "../glug.png";

import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

import GoogleLog from "../components/GoogleLog";
import FbLog2 from "../components/FbLog2";

import Particles from "react-particles-js";
import Timer from ''

function index() {
  return (
    <div>
      <style jsx>{`
        div {
          text-align: center;
          content-align: center;
          margin: 0px auto;
        }
      `}</style>

      <Particles
        params={{
          particles: {
            number: {
              value: 40,
              density: {
                enable: false,
                value_area: 500,
              },
            },
            color: {
              value: ["#cc0000"],
            },
            line_linked: {
              color: "#aa0044",
              opacity: 1,
            },
          },
        }}
        style={{
          width: "100%",
          height: "100%",
          top: 0,
          left: 0,
          position: "fixed",
          index: "-10",
        }}
      />
      <div>
        <div>
          <Head>
            <meta charset="UTF-8" />
            <meta
              name="viewport"
              content="width=device-width, initial-scale=1.0, shrink-to-fit:no"
            />
            <title>Screencast </title>
            <link rel="stylesheet" type="text/css" href="question.css" />
          </Head>
        </div>

        <Navbar />
        <Timer
              initialTime={55000}
              startImmediately={false}
          >
              {({ start, resume, pause, stop, reset, timerState }) => (
                  <React.Fragment>
                      <div>
                          <Timer.Days /> days
                          <Timer.Hours /> hours
                          <Timer.Minutes /> minutes
                          <Timer.Seconds /> seconds
                          <Timer.Milliseconds /> milliseconds
                      </div>
                      <div>{timerState}</div>
                      <br />
                      <div>
                          <button onClick={start}>Start</button>
                          <button onClick={pause}>Pause</button>
                          <button onClick={resume}>Resume</button>
                          <button onClick={stop}>Stop</button>
                          <button onClick={reset}>Reset</button>
                      </div>
                  </React.Fragment>
              )}
          </Timer>


        <div>
          <div
            className="sign"
            style={{
              marginTop: "140px",
              marginBottom: "20px",
              fontFamily: "'Russo One', sans-serif",
            }}
          >
            <span className="fast-flicker">screen</span>cast{" "}
            <span className="flicker">2020 </span>
          </div>
          <div className="login-head" style={{ marginBottom: "60px" }}>
            <h1>Login to play </h1>
          </div>
        </div>

        <GoogleLog />
        <FbLog2 />
      </div>
      <div
        style={{
          marginRight: "auto",
          marginLeft: "auto",
          textAlign: "center",
        }}
      >
        <img
          src={Logo}
          alt="logo"
          style={{
            marginTop: "90px",
            position: "relative",
            float: "bottom",
            height: "50px",
            width: "auto",
          }}
        />
      </div>
      <Footer style={{ color: "white" }} />
    </div>
  );
}

export default index;
